import { combineReducers } from "redux";
import authReducer from "./authReducer"; // authReducer dosyasının yolunu düzeltin

const rootReducer = combineReducers({
  auth: authReducer, // auth reducer'ını rootReducer'a ekleyin
  // Diğer reducerları buraya ekleyebilirsiniz
});

export default rootReducer;
